var tipuesearch = {"pages": [{'title': 'stage1-ag4', 'text': '題目:挖土機手臂 \n 小組網站: https://40823104.github.io/stage1-ag4/content/index.html \n 組員網站: https://40823101.github.io/cd2021/content/index.html \n', 'tags': '', 'url': 'stage1-ag4.html'}, {'title': 'w2', 'text': '今天確認主題為挖土機手臂結構， \n 動機為想 研究挖土機手臂構造及作動原理， \n 本周從AUTOCAD開始繪製2D圖檔，再利用SOLIDWORK繪製3D圖， \n 預計下周用 CoppeliaSim模擬測試及修改。 \n 參考資料: \n https://kknews.cc/zh-tw/news/nbx58m5.html \n 立體圖繪製影片: \n \n \n \n \n \n \n 立體組合圖影片: \n \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '將挖土機手臂的組合圖stl檔以coppeliasim作動測試 \n  (發現soildwork的組合圖轉為stl檔後會自動拆開,變成一個個零件stl檔,後來改成匯出成step檔後放入inventor,再轉成stl檔即可為完整的組合圖) \n 測試影片1:將組合件建立從屬關係,並在三個主動軸上添加虛擬軸,結果失敗,各零件四散 \n 結果1:失敗,各零件四散,疑似從屬關係不順 \n \n \n 測試影片2:重新建立組合件之從屬關係,並在各軸上增加虛擬軸以加強物件之間的約束 \n 結果2: 失敗,各零件四散,虛擬軸似乎和物件拘束關係無關 \n \n \n 測試影片3:以手動方式轉動虛擬軸 \n 結果3:失敗, 疑似因為我們的主題挖土機手臂需要多個零件互相約束,但coppeliasim只能以一個主動件配合多個從動件,無法讓一個零件既是主動件也是從動件,所以用程式作動時會出現零件約束不足,因此無法順利作動並且零件四散 \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w16', 'text': '1.w16雲端各檔案: \n https://drive.google.com/drive/folders/1lXGOcebYsqjznBxOJzrcsG8JJKB6s8HH?usp=sharing \n 2.影片 \n \n \n \n \n \n 心得:這是第一次使用onshape畫圖，覺得如果是簡易灀面畫會非常的方便，而且不向solidworks轉出stl檔時沒辦法組合圖轉出，這是十分方便的點。而這次使用coppeliasim後，雖然還是不夠熟悉，也因為之前大部分所負責的都以繪圖及網站居多，雖然在程式上出現了許多問題，但是我會多去看看同學的飲片，來看出自的問題何在，不過通過這次我相信會比上一次更佳的熟練，也謝謝老師的教學及同學們的幫忙', 'tags': '', 'url': 'w16.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};